import React, { Component } from "react";

export default class FetchAPI extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
    };
  }
  componentDidMount() {
    fetch("http://localhost:5050/user").then((res) => {
      res.json().then((result) => {
          console.log(result)
        this.setState({ name: result});
        console.log(this.state.name , "dada")

      });
    });
  }
  render() {
    return (
      <div>
        {this.state.name
          ? this.state.name.map((item, i) => (
              <p>
                {i}
                Email: {this.state.name[i].name}
                <br />
                Name:{item.first_name} {item.last_name}
                <br />
                avatar:{item.avatar}
              </p>
            ))
          : null}
      </div>
    );
  }
}
